import React from 'react';
import SocialItem from './SocialItem';


function Social() {
    return (
        <div className='list-group'>
            <SocialItem 
                p = {{
                    media: 'Facebook', 
                    id: 'facebook',
                    icon: 'bx bxl-facebook',
                }}
            />
            <SocialItem
                media = 'Youtube' 
                id = 'youtube'
                icon = 'bx bxl-youtube'
            />
            <SocialItem 
                media = 'Instagram' 
                id = 'instagram'
                icon = 'bx bxl-instagram'
            />
            <SocialItem 
                media = 'LinkedIn' 
                id = 'linkedin'
                icon = 'bx bxl-linkedin-square'
            />
        </div>
    );
};

export default Social;
